stats as (
select restaurant_id, avg((to_date(delivered_to_consumer_datetime, 'YYYY-MM-DD HH24:MI:SS') - to_date(customer_placed_order_datetime, 'YYYY-MM-DD HH24:MI:SS')) * 24 * 60) as order_duration_in_mins, avg((order_total - discount_amount + tip_amount - refunded_amount)) as net_order_value
from doordash_delivery
group by restaurant_id
)
select corr(order_duration_in_mins, net_order_value) as corr from stats;


